import React from "react";
import { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Loader from "./Components/loader/loader";
import DelayedRoute from "./Components/delayRoute/delayRoute";
import Home from "./Components/Pages/Home";
import About from "./Components/Pages/about_us";
import Services from "./Components/Pages/service";
import OurProcess from "./Components/Pages/our_process";
import MyPortfolio from "./Components/Pages/my_portfolio";
import ContactUs from "./Components/Pages/contactus";
import MyTeam from "./Components/Pages/myTeam";
import DevelopmentServices from "./Components/Pages/development_services";

const App = () => {
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Fake loading delay (e.g., for 1.5s)
    const timer = setTimeout(() => setLoading(false), 1500);
    return () => clearTimeout(timer);
  }, []);

  if (loading) return <Loader />;
  return (
    <Router>
      <Routes>
        <DelayedRoute path="/" element={<Home />} />
        <DelayedRoute path="/about" element={<About />} />
        <DelayedRoute path="/service" element={<Services />} />
        <DelayedRoute
          path="/service/development"
          element={<DevelopmentServices />}
        />
        <DelayedRoute path="/our-process" element={<OurProcess />} />
        <DelayedRoute path="/portfolio" element={<MyPortfolio />} />
        <DelayedRoute path="/team" element={<MyTeam />} />
        <DelayedRoute path="/contactus" element={<ContactUs />} />
      </Routes>
    </Router>
  );
};

export default App;
